  "translationLines": [
    {
      "lineNumber": 48311,
      "originalJapaneseLine": "　たぁっぷり、遊んであげる！」",
      "translatedEnglishLine": "\"I'll play with you to my heart's content!\""
    },
    {
      "lineNumber": 48312,
      "originalJapaneseLine": "色々なものを振り切って、",
      "translatedEnglishLine": "Shaking off various things,"
    },
    {
      "lineNumber": 48313,
      "originalJapaneseLine": "セルは石像の元までたどり着く。",
      "translatedEnglishLine": "Cell reached the statues."
    },
    {
      "lineNumber": 48314,
      "originalJapaneseLine": "「ランスさん、今…………」",
      "translatedEnglishLine": "\"Rance-san, now...\""
    },
    {
      "lineNumber": 48315,
      "originalJapaneseLine": "魔法を掛けるためにかざした手が、",
      "translatedEnglishLine": "The hand raised to cast magic,"
    },
    {
      "lineNumber": 48316,
      "originalJapaneseLine": "直前で止まる。",
      "translatedEnglishLine": "stopped just before."
    },
    {
      "lineNumber": 48317,
      "originalJapaneseLine": "「…………っ、え…………！？」",
      "translatedEnglishLine": "\"...Eh...!?\""
    },
    {
      "lineNumber": 48318,
      "originalJapaneseLine": "そこには、十数体の彫像が並べられていた。",
      "translatedEnglishLine": "There were a dozen or so statues lined up there."
    },
    {
      "lineNumber": 48319,
      "originalJapaneseLine": "その外見は、ほとんど見分けが付かない。",
      "translatedEnglishLine": "Their appearances were almost indistinguishable."
    },
    {
      "lineNumber": 48320,
      "originalJapaneseLine": "「そ、そんな、ッ……！」",
      "translatedEnglishLine": "\"N-No way...!\""
    },
    {
      "lineNumber": 48321,
      "originalJapaneseLine": "微妙な違いをつぶさに調べれば、",
      "translatedEnglishLine": "If I carefully examined the subtle differences,"
    },
    {
      "lineNumber": 48322,
      "originalJapaneseLine": "ランスを特定できるかもしれない。",
      "translatedEnglishLine": "I might be able to identify Rance."
    },
    {
      "lineNumber": 48323,
      "originalJapaneseLine": "だが、そんな余裕はない。",
      "translatedEnglishLine": "But there's no time for that."
    },
    {
      "lineNumber": 48324,
      "originalJapaneseLine": "ひとつの彫像に、祈りを込めて手をかざす。",
      "translatedEnglishLine": "She placed her hand on one statue with a prayer."
    },
    {
      "lineNumber": 48325,
      "originalJapaneseLine": "「神よ、っ……お助け下さい……！」",
      "translatedEnglishLine": "\"God... please help me...!\""
    },
    {
      "lineNumber": 48326,
      "originalJapaneseLine": "「う、うう、っ……あれ、ここは…………？」",
      "translatedEnglishLine": "\"U-ugh... huh, where is this...?\""
    },
    {
      "lineNumber": 48327,
      "originalJapaneseLine": "「あっ……ああぁぁっ……！",
      "translatedEnglishLine": "\"Ah... aahhh...!"
    },
    {
      "lineNumber": 48328,
      "originalJapaneseLine": "　違う、ランスさんじゃ、っ……！」",
      "translatedEnglishLine": "No, this isn’t Rance-san...!\""
    },
    {
      "lineNumber": 48329,
      "originalJapaneseLine": "「はぁい、残念☆」",
      "translatedEnglishLine": "\"Haai, tough luck☆\""
    },
    {
      "lineNumber": 48330,
      "originalJapaneseLine": "「――――！！」",
      "translatedEnglishLine": "\"――――!!\""
    },
    {
      "lineNumber": 48331,
      "originalJapaneseLine": "背後から、メディウサの爪が容赦なく襲いかかった。",
      "translatedEnglishLine": "From behind, Medusa’s claws struck mercilessly."
    },
    {
      "lineNumber": 48332,
      "originalJapaneseLine": "「いったたたた……！",
      "translatedEnglishLine": "\"Ouch ouch ouch...!"
    },
    {
      "lineNumber": 48333,
      "originalJapaneseLine": "　まともに受けたらあの世行きね……っ！」",
      "translatedEnglishLine": "If I took that blow head-on, I'd be a goner...!"
    },
    {
      "lineNumber": 48334,
      "originalJapaneseLine": "「簡単には死なさないわよぉ……！",
      "translatedEnglishLine": "\"I’m not going to let you die so easily...!"
    },
    {
      "lineNumber": 48335,
      "originalJapaneseLine": "　綺麗に気持ちよくバラバラになりなさいな、",
      "translatedEnglishLine": "You’ll be torn apart nicely and pleasurably,"
    },
    {
      "lineNumber": 48336,
      "originalJapaneseLine": "　お嬢ちゃん！」",
      "translatedEnglishLine": "little girl!\""
    },
    {
      "lineNumber": 48337,
      "originalJapaneseLine": "「意外とご同輩、なんだけどね、っと！」",
      "translatedEnglishLine": "\"You’re surprisingly a worthy opponent, you know!\""
    },
    {
      "lineNumber": 48338,
      "originalJapaneseLine": "旋風のように吹き荒れる爪を、刀をかいくぐって、",
      "translatedEnglishLine": "Ducking and weaving through the claws swirling like a whirlwind,"
    },
    {
      "lineNumber": 48339,
      "originalJapaneseLine": "カフェは巧みにメディウサの懐に飛び込む。",
      "translatedEnglishLine": "Cafe skillfully charged into Medusa’s close range."
    },
    {
      "lineNumber": 48340,
      "originalJapaneseLine": "「大きいと、小回り効かないでしょ！」",
      "translatedEnglishLine": "\"Being big means you can’t maneuver quickly!\""
    },
    {
      "lineNumber": 48341,
      "originalJapaneseLine": "「甘い…………！」",
      "translatedEnglishLine": "\"Too naïve...!\""
    },
    {
      "lineNumber": 48342,
      "originalJapaneseLine": "カフェの背後から、大蛇のような尾が襲いかかる。",
      "translatedEnglishLine": "From behind Cafe, a snake-like tail attacked."
    },
    {
      "lineNumber": 48343,
      "originalJapaneseLine": "「――――――――！」",
      "translatedEnglishLine": "\"――――――――!\""
    },
    {
      "lineNumber": 48344,
      "originalJapaneseLine": "「…………っ！？」",
      "translatedEnglishLine": "\"...!?\""
    },
    {
      "lineNumber": 48345,
      "originalJapaneseLine": "カフェはその一撃を待っていたかのように",
      "translatedEnglishLine": "Cafe seemed to be waiting for that strike,"
    },
    {
      "lineNumber": 48346,
      "originalJapaneseLine": "杖とバリアで受け、そのまま転がっていく。",
      "translatedEnglishLine": "blocked it with her staff and barrier, then rolled forward."
    },
    {
      "lineNumber": 48347,
      "originalJapaneseLine": "背面の背面、つまり前方……メディウサの後ろまで。",
      "translatedEnglishLine": "Behind the backside — that is, to the front... behind Medusa."
    },
    {
      "lineNumber": 48348,
      "originalJapaneseLine": "「げほっ、あいたたた……",
      "translatedEnglishLine": "\"Geh, ouch ouch..."
    },
    {
      "lineNumber": 48349,
      "originalJapaneseLine": "　でも、たどり着いた……！」",
      "translatedEnglishLine": "But I made it...!\""
    },
    {
      "lineNumber": 48350,
      "originalJapaneseLine": "「ランス君、ついでにカオスも！",
      "translatedEnglishLine": "\"Rance-kun, and Chaos too!"
    },
    {
      "lineNumber": 48351,
      "originalJapaneseLine": "　まったくもー、手間かけさせて！",
      "translatedEnglishLine": "Geez, making me go through all this trouble!"
    },
    {
      "lineNumber": 48352,
      "originalJapaneseLine": "　今すぐ…………」",
      "translatedEnglishLine": "Right now...\""
    },
    {
      "lineNumber": 48353,
      "originalJapaneseLine": "魔法を掛けるためにかざした手が、",
      "translatedEnglishLine": "The hand raised to cast magic,"
    },
    {
      "lineNumber": 48354,
      "originalJapaneseLine": "直前で止まる。",
      "translatedEnglishLine": "stopped just before."
    },
    {
      "lineNumber": 48355,
      "originalJapaneseLine": "「………………まじで？」",
      "translatedEnglishLine": "\"...Seriously?\""
    },
    {
      "lineNumber": 48356,
      "originalJapaneseLine": "そこには、十数体の彫像が並べられていた。",
      "translatedEnglishLine": "There were a dozen or so statues lined up there."
    },
    {
      "lineNumber": 48357,
      "originalJapaneseLine": "その外見は、ほとんど見分けが付かない。",
      "translatedEnglishLine": "Their appearances were almost indistinguishable."
    },
    {
      "lineNumber": 48358,
      "originalJapaneseLine": "微妙な違いをつぶさに調べれば、",
      "translatedEnglishLine": "If I carefully examined the subtle differences,"
    },
    {
      "lineNumber": 48359,
      "originalJapaneseLine": "ランス、あるいはカオスを特定できるかもしれない。",
      "translatedEnglishLine": "I might be able to identify Rance or Chaos."
    },
    {
      "lineNumber": 48360,
      "originalJapaneseLine": "かもしれないが――――",
      "translatedEnglishLine": "Maybe, but――――"
    },
    {
      "lineNumber": 48361,
      "originalJapaneseLine": "「そんな余裕ありますかーってのー！",
      "translatedEnglishLine": "\"Who on earth has time for that!?\""
    },
    {
      "lineNumber": 48362,
      "originalJapaneseLine": "　もー！　こうなったらイチかバチか……",
      "translatedEnglishLine": "Damn it! At this point, it’s all or nothing..."
    },
    {
      "lineNumber": 48363,
      "originalJapaneseLine": "　君に決めたーーーー！」",
      "translatedEnglishLine": "I choose youーーーー!\""
    },
    {
      "lineNumber": 48364,
      "originalJapaneseLine": "「う、うむ……？　ここは……」",
      "translatedEnglishLine": "\"U-umm...? Where is this...?\""
    },
    {
      "lineNumber": 48365,
      "originalJapaneseLine": "「…………あちゃあ、ハズレ……",
      "translatedEnglishLine": "\"...Oops, no luck..."
    },
    {
      "lineNumber": 48366,
      "originalJapaneseLine": "　私、ほんと運がないよねぇ……」",
      "translatedEnglishLine": "I really have no luck, do I...?\""
    },
    {
      "lineNumber": 48367,
      "originalJapaneseLine": "「はぁい、残念☆」",
      "translatedEnglishLine": "\"Haai, tough luck☆\""
    },
    {
      "lineNumber": 48368,
      "originalJapaneseLine": "「くっ…………！」",
      "translatedEnglishLine": "\"Ugh...!\""
    },
    {
      "lineNumber": 48369,
      "originalJapaneseLine": "背後から、メディウサの爪が容赦なく襲いかかった。",
      "translatedEnglishLine": "From behind, Medusa’s claws struck mercilessly."
    },
    {
      "lineNumber": 48370,
      "originalJapaneseLine": "「ラ、ランスさん……ランスさんを、",
      "translatedEnglishLine": "\"R-Rance-san... Rance-san..."
    }
  ]
}

